# coding: utf-8
from flask import Flask, render_template, flash, redirect, url_for,session,request,send_from_directory
from wtforms import StringField, PasswordField, BooleanField,SubmitField,IntegerField
from wtforms.validators import DataRequired ,Length,Optional
from  flask_wtf import FlaskForm,Form
from flask_wtf.file import FileField
import os,uuid
from flask_sqlalchemy import SQLAlchemy
import base64

app = Flask(__name__)
app.config['WTF_I18N_ENABLED']=False
app.config['SQLALCHEMY_DATABASE_URI']=os.getenv('DATABASE_URL','sqlite:///'+os.path.join(app.root_path,'data.db'))
app.config['SQLALCHEMY_TRACK_MODIFICATIONS']=False
app.secret_key = 'secret string'
app.config['UPLOAD_PATH']=os.path.join(app.root_path,'uploads')
db=SQLAlchemy(app)


class Note(db.Model):
    id=db.Column(db.Integer,primary_key=True)
    username=db.Column(db.String(16),nullable=False)
    password=db.Column(db.String(16),nullable=False)
    photo=db.Column(db.String(2048),default='')

class Video(db.Model):
    id=db.Column(db.Integer,primary_key=True)
    videoname=db.Column(db.String(16),nullable=False)
    title=db.Column(db.String(16),nullable=False)
    video=db.Column(db.String(2048))
    note_id=db.Column(db.Integer)

class Comment(db.Model):
    id=db.Column(db.Integer,primary_key=True)
    comment=db.Column(db.Text)
    username=db.Column(db.String(16))
    video_id=db.Column(db.Integer)
    photo=db.Column(db.String(2048))

class Reply2(db.Model):
    id=db.Column(db.Integer,primary_key=True)
    replyto=db.Column(db.Text)
    username=db.Column(db.String(16))
    comment_id=db.Column(db.Integer)
    photo=db.Column(db.String(2048))
    video_id=db.Column(db.Integer)

class Author(db.Model):
    id=db.Column(db.Integer,primary_key=True)
    username=db.Column(db.String(16),nullable=False)
    password=db.Column(db.String(16),nullable=False)

class LoginForm(FlaskForm):
    username=StringField('账号',validators=[DataRequired()])
    password=PasswordField('密码',validators=[DataRequired(),Length(8,16)])
    remember=BooleanField('记住我')
    submit=SubmitField('登录')

class RegisterForm(FlaskForm):
    username=StringField('账号',validators=[DataRequired(),Length(5,16)])
    password=PasswordField('密码',validators=[DataRequired(),Length(8,16)])
    repeatpass=PasswordField('重复密码',validators=[DataRequired(),Length(8,16)])
    submit=SubmitField('注册')

class Update(Form):
    username=StringField('新用户名')
    password=PasswordField('新密码')
    photo=FileField('上传图片')
    submit=SubmitField('提交')

class AuthorForm(FlaskForm):
    username=StringField('管理员账号',validators=[DataRequired()])
    password=PasswordField('管理员密码',validators=[DataRequired(),Length(8,16)])
    submit=SubmitField('登录')

class UploadForm(Form):
    videoname=StringField('视频类别【‘鬼畜’，‘热血’，‘休闲’】')
    title=StringField('视频标题')
    video=FileField('上传视频')
    submit = SubmitField('提交')

class CommentForm(FlaskForm):
    comment=StringField('评论',validators=[DataRequired()])
    submit=SubmitField('发表评论')

class ReplyForm(FlaskForm):
    com=StringField('评论')
    submit=SubmitField('回复')

class manageuser(FlaskForm):
    username=StringField('用户用户名')
    submit1 = SubmitField('注销')

class managecomment(FlaskForm):
    commentvideo_id=IntegerField('视频ID')
    comment_id=IntegerField('上级评论ID(无则填0)')
    comment_user=StringField('评论用户名')
    reply_user=StringField('回复评论用户名(无则填0)')
    submit2=SubmitField('删除')

class managevideo(FlaskForm):
    video_id=IntegerField('视频ID',validators=[Optional()])
    submit3=SubmitField('删除')

def random_filename(filename):
    ext=os.path.splitext(filename)[1]
    new_filename=uuid.uuid4().hex + ext
    return new_filename

usernames=['一号管理','二号管理','三号管理','四号管理','五号管理']
passwords=['one-author','two-author','three-author','four-author','five-author']
dic=dict(zip(usernames,passwords))
for u,p in dic.items():
    new_author=Author(username=u,password=p)
    db.create_all()
    db.session.add(new_author)
    db.session.commit()

@app.route('/')
def index():
    if Video.query.all():
        video = Video.query.all()
    else:
        video=0
    if 'login_in' in session:
        note_id=session['login_in']
        note=Note.query.get(note_id)
        return render_template('index.html',form=note,video=video)
    return render_template('index.html',video=video)

@app.route('/login',methods=['GET','POST'])
def login():
    form=LoginForm()
    if form.validate_on_submit():
        username=form.username.data
        password=form.password.data
        if Note.query.filter(Note.username==username).first():
            note = Note.query.filter(Note.username == username).first()
            if note.password == password:
                flash('欢迎回来，%s!' % note.username)
                session['login_in'] = note.id
                return redirect(url_for('index'))
            flash('密码错误')
            return redirect(url_for('login'))
        flash('用户名不存在')
        return redirect(url_for('login'))
    return render_template('login.html',form=form)

@app.route('/register',methods=['GET','POST'])
def register():
    form=RegisterForm()
    if form.validate_on_submit():
        if form.password.data == form.repeatpass.data:
            username = form.username.data
            password = form.password.data
            if Note.query.filter(Note.username==username).first():
                flash('用户名已存在')
                return redirect(url_for('register'))
            new_note = Note(username=username, password=password)
            db.session.add(new_note)
            db.session.commit()
            flash('注册成功，欢迎你!')
            return redirect(url_for('login'))
        else:
            flash('两次输入的密码不一致')
            return redirect(url_for('register'))
    return render_template('register.html', form=form)

@app.route('/login_out')
def login_out():
    session.pop('login_in')
    flash('有空还常来哦！')
    return redirect(url_for('index'))

@app.route('/user/<int:user_id>')
def user(user_id):
    form=Note.query.get(user_id)
    video=Video.query.filter(Video.note_id==user_id).all()
    return render_template('user.html',form=form,video=video)

@app.route('/update/<int:note_id>',methods=['GET','POST'])
def update(note_id):
    form=Update()
    note=Note.query.get(note_id)
    if request.method == 'POST' and form.validate():
        username=form.username.data
        if Note.query.filter(Note.username==username).first():
            flash('用户名已存在')
            return redirect(url_for('update',note_id=note_id))
        password=form.password.data
        photo = request.files['photo'].read()
        photo=base64.b64encode(photo)
        photo = str(photo, 'utf8')
        note.username=username
        note.password=password
        note.photo=photo
        db.session.commit()
        flash('信息修改完成')
        return redirect(url_for('index'))
    return render_template('update.html',form=note,note=form)

@app.route('/upload/<int:note_id>',methods=['GET','POST'])
def upload(note_id):
    form=UploadForm()
    note=Note.query.get(note_id)
    if request.method == 'POST' and form.validate():
        videoname=form.videoname.data
        title=form.title.data
        video=form.video.data
        filename=random_filename(video.filename)
        video.save(os.path.join(app.config['UPLOAD_PATH'],filename))
        flash('upload success')
        video=filename
        new_video=Video(videoname=videoname,title=title,video=video,note_id=note.id)
        db.session.add(new_video)
        db.session.commit()
        return redirect(url_for('index'))
    return render_template('video.html',form=note,note=form)

@app.route('/uer/<path:filename>')
def get_file(filename):
    return send_from_directory(app.config['UPLOAD_PATH'],filename=filename)

@app.route('/uservideo/<int:video_id>',methods=['GET','POST'])
def uservideo(video_id):
    video=Video.query.get(video_id)
    filename=video.video
    note_id=video.note_id
    note=Note.query.get(note_id)
    form=CommentForm()
    replies=Reply2.query.filter(Reply2.video_id==video_id).all()
    if 'login_in' in session:
        form1_id=session['login_in']
        form1=Note.query.get(form1_id)
        if form1.photo:
            photo = form1.photo
        else:
            photo=0
    else:
        form1=0
        photo=0
    if form.validate_on_submit():
        comment = form.comment.data
        new_comment = Comment(username=form1.username, comment=comment, video_id=video_id,photo=photo)
        db.session.add(new_comment)
        db.session.commit()
        return redirect(url_for('uservideo',video_id=video_id))
    comments=Comment.query.filter(Comment.video_id==video_id).all()
    return render_template('uservideo.html', filename=filename, form=note, video=video,com=form,comments=comments,form1=form1,replies=replies)

@app.route('/reply/<int:comment_id>/<int:note_id>',methods=['GET','POST'])
def reply(comment_id,note_id):
    form=ReplyForm()
    note=Note.query.get(note_id)
    comment=Comment.query.get(comment_id)
    if form.validate_on_submit():
        replyto=form.com.data
        if note.photo:
            photo=note.photo
        else:
            photo=0
        new_reply=Reply2(replyto=replyto,username=note.username,comment_id=comment.id,photo=photo,video_id=comment.video_id)
        db.create_all()
        db.session.add(new_reply)
        db.session.commit()
        return redirect(url_for('uservideo',video_id=comment.video_id))
    return render_template('reply.html',form=note,note=form)

@app.route('/author',methods=['GET','POST'])
def author():
    form=AuthorForm()
    if form.validate_on_submit():
        username=form.username.data
        password=form.password.data
        if Author.query.filter(Author.username==username,Author.password==password).first():
            author=Author.query.filter(Author.username==username,Author.password==password).first()
            session['author_id']=author.id
            return redirect(url_for('index'))
        flash('管理员账号或者密码错误')
        return redirect(url_for('author'))
    return render_template('author.html',form=form)

@app.route('/manage',methods=['GET','POST'])
def manage():
    form1=manageuser()
    form2=managecomment()
    form3=managevideo()
    if form1.submit1.data and form1.validate_on_submit():
        username=form1.username.data
        if Note.query.filter(Note.username==username).first():
            user=Note.query.filter(Note.username==username).first()
            if Video.query.filter(Video.note_id==user.id).all():
                videos=Video.query.filter(Video.note_id==user.id).all()
                for video in videos:
                    db.session.delete(video)
            if Comment.query.filter(Comment.username==user.username).all():
                comments=Comment.query.filter(Comment.username==user.username).all()
                for comment in comments:
                    db.session.delete(comment)
            if Reply2.query.filter(Reply2.username==user.username).all():
                replies=Reply2.query.filter(Reply2.username==user.name).all()
                for reply in replies:
                    db.session.delete(reply)
            db.session.delete(user)
            if 'login_in' in session:
                session.pop('login_in')
            db.session.commit()
            flash('已注销用户')
            return redirect(url_for('manage'))
        flash('该用户不存在')
        return redirect(url_for('manage'))
    if form2.submit2.data and form2.validate_on_submit():
        commentvideo_id=form2.commentvideo_id.data
        comment_user=form2.comment_user.data
        reply_user=form2.reply_user.data
        comment_id=form2.comment_id.data
        if Comment.query.filter(Comment.video_id==commentvideo_id,Comment.username==comment_user).first():
            comment=Comment.query.filter(Comment.video_id==commentvideo_id,Comment.username==comment_user).first()
            if Reply2.query.filter(Reply2.video_id==commentvideo_id,Reply2.username==reply_user,Reply2.comment_id==comment_id).first():
                reply=Reply2.query.filter(Reply2 .video_id==commentvideo_id,Reply2.username==reply_user,Reply2.comment_id==comment_id).first()
                db.session.delete(reply)
                db.session.commit()
                flash('已删除回复区该评论')
                return redirect(url_for('manage'))
            db.session.delete(comment)
            db.session.commit()
            flash('已删除评论')
            return redirect(url_for('manage'))
        flash('删除失败')
        return redirect(url_for('manage'))
    if form3.submit3.data and form3.validate_on_submit():
        video_id=form3.video_id.data
        if Video.query.get(video_id):
            video=Video.query.get(video_id)
            if Comment.query.filter(Comment.video_id==video_id).all():
                comments=Comment.query.filter(Comment.video_id==video_id).all()
                for comment in comments:
                    db.session.delete(comment)
            if Reply2.query.filter(Reply2.video_id==video_id).all():
                replies=Reply2.query.filter(Reply2.video_id==video_id).all()
                for reply in replies:
                    db.session.delete(reply)
            db.session.delete(video)
            db.session.commit()
            flash('已删除视频')
            return redirect(url_for('manage'))
        flash('视频不存在')
        return redirect(url_for('manage'))
    return render_template('manage.html',form1=form1,form2=form2,form3=form3)

if __name__ == '__main__':
    app.run()
